import React from 'react';
import { BrowserRouter as Router, Route, Link } from "react-router-dom";
import './nav.css';

function Nav(props) {
  return (
    <div class="navbar nav">
            <h3 class="nav-link" href="/">Home</h3>
            <h3 class="nav-link" href="/micros/">Microgreens</h3>
            <h3 class="nav-link" href="/natives/">Native Plants</h3>
            <h3 class="nav-link" href="/team/">Team</h3>
      </div>
  );
}

export default Nav;
